(1, 'd0558a032ad4f07fda74086628d1b5df', '<div class="no-overflow"><p><a href="http://www.bnm.gov.my/index.php"><img src="http://upload.wikimedia.org/wikipedia/en/thumb/9/90/Central_Bank_of_Malaysia_logo.png/70px-Central_Bank_of_Malaysia_logo.png" height="33" /></a> <a href="http://twitter.com/AKPK1"><img src="http://inkstainedknuckle.files.wordpress.com/2010/05/twitter_logo.png" height="33" width="33" /> </a><a href="http://www.facebook.com/pages/Kuala-Lumpur-Malaysia/AGENSI-KAUNSELING-DAN-PENGURUSAN-KREDIT-AKPK/92509128293"><img src="http://inkstainedknuckle.files.wordpress.com/2010/05/facebooklogo.png" height="33" width="33" /></a><a href="http://www.speaksens.com.my/"><img height="33" width="33" src="http://www.akpk.org.my/Portals/0/images/connect.png" /></a></p></div>', 1304465576),
(2, '5852f4f8d8dd2e21a8c3ff388079d9d9', '<div class="no-overflow"><p><a href="http://www.bnm.gov.my/index.php"><img src="http://upload.wikimedia.org/wikipedia/en/thumb/9/90/Central_Bank_of_Malaysia_logo.png/70px-Central_Bank_of_Malaysia_logo.png" height="33" /></a> <a href="http://twitter.com/AKPK1"><img src="http://inkstainedknuckle.files.wordpress.com/2010/05/twitter_logo.png" height="33" width="33" /> </a><a href="http://www.facebook.com/pages/Kuala-Lumpur-Malaysia/AGENSI-KAUNSELING-DAN-PENGURUSAN-KREDIT-AKPK/92509128293"><img src="http://inkstainedknuckle.files.wordpress.com/2010/05/facebooklogo.png" height="33" width="33" /></a><a href="http://www.speaksens.com.my/"><img height="33" width="33" src="http://www.akpk.org.my/Portals/0/images/connect.png" /></a></p></div>', 1304122958),
(3, '5538729cd7909d9ce79a2d6485b43b0e', '<div class="text_to_html">Default for Power_bm</div>', 1304464142),
(4, 'b9e9e08fb68829876b648c6aaf5a28d7', '<div class="text_to_html">The default category for questions shared in context ''Power_bm''.</div>', 1304464142),
(5, '752302e516cd60740cc254d603d321a2', '<p>Apakah komponen utama di dalam pengurusan aliran tunai?</p>', 1306823205),
(6, '408ea7a23d91a10c28358954d5bd063e', '<p>Bajet dapat membantu anda untuk ________</p>', 1306825977),
(7, 'b899aa1355f180fb1fe855384c286565', '<p>Kenapakah menabung itu penting?</p>', 1306823205),
(8, '2508027fa1953bfc02641d2ea2c26a2e', '<p>Berapa bulan kos perbelanjaan sara hidup disarankan sebagai dana kecemasan anda?</p>', 1306823205),
(9, '28a13a1a45e5b65fb774be3926c47890', '<p>Apakah nilai harta bersih anda?</p>', 1306823205),
(10, '8e2b72df6562fc91b01a80f03be56975', '<p>Berapakah peratus kadar minimum sebulan dari pendapatan anda disarankan sebagai tabungan (tidak termasuk caruman KWSP)?</p>', 1306825977),
(11, '4e30e755374330d237a9f47b83541b62', '<p>Apakah tabiat pengurusan kewangan yang baik?</p>', 1306823205),
(12, '75294d17bdf54842eeec114476ad512d', '<p>Kadar faedah untuk pinjaman tidak bercagar kebiasaannya __________</p>', 1304464143),
(13, '523857190256dfd0f7211fa85dbedf30', '<p>Berikut adalah kriteria penilaian kredit yang digunakan oleh institusi kewangan apabila mempertimbangkan permohonan pinjaman:</p>', 1304464143),
(14, '380c94ea6fb872a688898b60383db476', '<p>Nisbah hutang kepada pendapatan anda disarankan tidak melebihi _________</p>', 1304464143),
(15, 'd49236277b7d2052f42a4b964d3a7c8c', '<p>Sekiranya anda adalah seorang penjamin, bank boleh ______</p>', 1304464143),
(16, '1152ab1481ccfbf70dab1961720fcebb', '<p>Berikut adalah keterangan tentang mekanisme faedah kompaun?</p>', 1304464143),
(17, 'bbbbe9ad3513ed6f57f348361a6fbeb7', '<p>Keterangan berikut adalah BENAR tentang Perbankan Islam?</p>', 1304464143),
(18, '18a015b802d58487debf8bd829d0a6ef', '<p>Yang manakah diantara berikut adalah kelebihan menggunakan kad kredit?</p>', 1304464143),
(19, '1d1ad0bc75327665969e979efa8c8a24', '<p>Pengeluaran tunai dari kad kredit adalah cara yang paling mudah untuk mendapatkan wang tunai segera, tetapi ianya hendaklah digunakan ____ kerana caj yang akan dikenakan adalah tinggi.</p>', 1304464143),
(20, '10d2674536b10c2a19f54b8e45a726ca', '<p>Yang manakah diantara berikut adalah tip penggunaan kad kredit yang bijak?</p>', 1304464144),
(21, '204c30ae8eab3e3acdebcf76b6059f6b', '<p>Jika anda membayar bil kad kredit selepas tarikh matang, anda akan dikenakan ________</p>', 1304464144),
(22, 'c838ce4f0388a326998ac76588191b9d', '<p>Yang manakah antara berikut TIDAK BENAR mengenai kad kredit:</p>', 1304464144),
(23, 'abd18fd51c38588f7b8ff0ab10a33cf5', '<p>Pengguna kad caj perlu membayar ______ yang tercatat dalam penyata bulanan atau boleh dikenakan denda lewat bayar</p>', 1304464144),
(24, '25bc251d71a5988b5cbdb312ddddcbb9', '<p>Kad manakah yang paling sesuai untuk digunakan sekiranya hendak mengawal disiplin kewangan?</p>', 1304464144),
(25, '4b48f5aa45abe695d3bc8463a23722ff', '<p>Untuk mengelak penipuan, anda perlu</p>', 1304464039),
(26, '97feb4e70be5ee8a85edb4b44d15a087', '<p>Jika kad anda telah hilang/dicuri, anda terlebih dahulu perlu _________</p>', 1304464039),
(27, '07758c159fd46129dc1f9f18875bac56', '<p>Sebelum membeli kereta, adalah penting bagi anda untuk ______</p>', 1304464039),
(28, '1b6ce456f01894a3de6ce8dfad2da2e2', '<p>Berdasarkan Akta Sewabeli 1967, anda tidak dibenarkan menjual atau memindah milik kenderaan tersebut kepada pihak ketiga tanpa kebenaran dari ____ anda.</p>', 1304464039),
(29, '71ea26cb7729982bac47d836a2dd1882', '<p>Apabila anda mengambil pinjaman kereta, anda perlu _______</p>', 1304464039),
(30, '1706edd107e72c3005486fd14f5136b2', '<p>Salah satu daripada berikut BUKAN berkaitan dengan pinjaman sewabeli:</p>', 1304464039),
(31, '27c802da28729281839f8097a9088454', '<p>Jika anda gagal/ingkar membayar ansuran kereta selama dua bulan berturut-turut, maka pihak bank boleh ________</p>', 1304464039),
(32, '5b6d392f4c577169cf8b325163a10d65', '<p>Berikut adalah kelebihan membeli kereta baru berbanding kereta terpakai, KECUALI:</p>', 1304464039),
(33, '2809707c23d684b35dcb5bff5ce428d8', '<p>Berikut adalah kenyataan yang BENAR tentang proses penarikan balik kenderaan KECUALI:</p>', 1304464039),
(34, '3a8e63b6988adffd3ad4b262faf1001b', '<p>Apabila membeli rumah, anda perlu _________________</p>', 1304464039),
(35, '05b78ebe89c2c145350c5f09585ef978', '<p>Umumnya, memiliki rumah sendiri bermaksud seperti berikut, KECUALI:</p>', 1304464039),
(36, '0c4e479df6a263d54e7ae275fc9444d7', '<p>Apabila anda berhasrat untuk memohon pinjaman perumahan, apakah faktor utama yang perlu dipertimbangkan?</p>', 1304464039),
(37, '9d0f3f8066611cf9a955df74a7f5f29b', '<p>Berikut adalah kos secara langsung dan kos tidak lansung yang terlibat dalam urusan pembelian rumah, KECUALI:</p>', 1304464039),
(38, '67bf21e5e6a95ce83536ea2038174b60', '<p>Ali memperoleh pinjaman perumahan pada kadar faedah yang ditetapkan pada Kadar Pinjaman Asas (KPA). Yang manakah antara berikut BENAR jika berlaku kenaikan KPA?</p>', 1304464040),
(39, 'f7388f5c1e889656d7337daec9dc0aba', '<p>Jika anda memperoleh pinjaman perumahan secara bersama dengan pasangan anda dan membeli Insurans Bertempoh Gadai Janji Berkurangan sebanyak RM100,000 secara samarata. Apa akan berlaku sekiranya pasangan anda meninggal dunia?</p>', 1304464040),
(40, '0d6136e009475698eb9a15d59125049b', '<p>Berikut adalah perlindungan insurans tambahan, selain daripada Insurans Bertempoh Gadai Janji Berkurangan, yang berkaitan dengan rumah anda, KECUALI:</p>', 1304464040),
(41, '482f7256aa5e94786760985e188c0209', '<p>Pengurusan hutang yang baik membolehkan kita ________</p>', 1304464144),
(42, 'c03ae57c55ba9882dbb3e152b85b3375', '<p>Yang manakah antara berikut akan memberi kesan negatif terhadap kedudukan kredit anda?</p>', 1304464144),
(43, '45010e1f333f6f89e5e6fc9a1ad97b12', '<p>Berikut adalah tanda awal yang boleh menyebabkan masalah kewangan, KECUALI:</p>', 1304464144),
(44, 'a531bbe187e0ef4e6d325009687e23c4', '<p>Berikut adalah langkah susulan yang boleh diambil oleh seseorang bagi mengawal masalah kewangan:</p>', 1304464144),
(45, 'e90db181453c77cef362e6cc12922ef6', '<p>Yang manakah diantara berikut TIDAK BENAR berkenaan dengan seseorang yang telah diisytiharkan bankrap?</p>', 1304464144),
(46, '0bed925b5825dd5ffb7e3084cf96b426', '<p>Agensi Kaunseling dan Pengurusan Kredit (AKPK) menyediakan kesemua perkhidmatan berikut, KECUALI:</p>', 1304464144),
(47, '7d45881630ddd0b21464e820a894204c', '<p>Anda boleh mengetahui kedudukan kredit anda melalui laporan kredit (CCRIS) di Bank Negara Malaysia. Akronim ‘CCRIS’ ini merujuk kepada:</p>', 1304464144),
