(172, 'bd5f58c92ed43a1c57789d24d2f8ea2b', '<p>A tick next an activity name may be used to indicate when the activity is complete.</p>\n\n<p>If a dotted tick is shown, you can click it to tick the box when you think you have completed the activity. (Clicking it again removes the tick if you change your mind.) The tick is optional and is simply a way of tracking your progress through the course.</p>\n\n<p>If a blank tick box is shown, a tick will appear automatically when you have completed the activity according to conditions set by the teacher.</p>\n', 1306823012),
(173, '9aacb3d43dffd54509d5e1fa0d062347', 'Sejauhmanakah program ini mencapai objektifnya?', 1307994367),
(174, '1d2e3c05a9d090ac46945bd30575adaf', 'Apa pendapat anda tentang mutu penyampaian OLP! Power?', 1307992169),
(175, 'e5f7234a9e11d65ddae85edfda1be2e7', 'Adakah anda akan mengesyorkan program ini kepada orang lain?', 1307994368),
(176, '4bcc3af102ca4d4aa26aa8b763e2cdcf', 'Apa pendapat anda tentang mutu penyampaian program ini?', 1307994368),
(177, '152af85eb21769b30d952f3522c4e5a5', '<div class="no-overflow"><p>Peserta yang dihormati,</p>\r\n<p> </p>\r\n<p>Kami ingin membuat tinjauan samada taklimat yang diberikan menepati kehendak anda. Maklumbalas dari anda boleh membantu kami untuk memperbaiki mutu persembahan kami. Terima kasih atas kesudian anda untuk memberi maklumbalas.</p></div>', 1307994358),
(178, 'ec082c200d80b0e3ed5e43eaefb69af7', '<div class="no-overflow"><p>Dear participants,</p>\r\n<p> </p>\r\n<p>We wish to get your feedback to enable us to enhance the quality of our presentation. Your kind cooperation is highly appreciated. Thank you.</p></div>', 1307994419),
(179, 'b5df03a5d4a420e96b5d86d2d090aec4', 'To what extent is this program achieve its objectives?', 1307994429),
(180, 'b54857d84e8f0b8eebf987d64a88749f', 'How do you rate our OLP Power! Programme presentation?', 1307994429),
(181, 'ccd040a570af92dc8c52c924130de7dd', 'Would you recommend this briefing to others?', 1307994429),
(182, '74f2fa83a7a640752e1e279d6a0225ac', 'Other Comments', 1307993070),
(183, '0406f9a55458b9ade793557c8063851a', 'Other Comments (if any):', 1307994429),
(184, 'a984c79f6cf4a6f84600970a69a20328', 'Lain-lain cadangan atau komen (jika ada)', 1307994347);
