INSERT INTO `feedback` (`id`, `course`, `name`, `intro`, `introformat`, `anonymous`, `email_notification`, `multiple_submit`, `autonumbering`, `site_after_submit`, `page_after_submit`, `page_after_submitformat`, `publish_stats`, `timeopen`, `timeclose`, `timemodified`, `completionsubmit`) VALUES
(1, 2, 'Power! Feedback Survey', '<p>Dear participants,</p>\r\n<p> </p>\r\n<p>We wish to get your feedback to enable us to enhance the quality of our presentation. Your kind cooperation is highly appreciated. Thank you.</p>', 1, 2, 0, 0, 0, '', '', 1, 1, 0, 0, 1307992778, 1),
(2, 3, 'Maklumbalas Program', '<p>Peserta yang dihormati,</p>\r\n<p> </p>\r\n<p>Kami ingin membuat tinjauan samada taklimat yang diberikan menepati kehendak anda. Maklumbalas dari anda boleh membantu kami untuk memperbaiki mutu persembahan kami. Terima kasih atas kesudian anda untuk memberi maklumbalas.</p>', 1, 2, 0, 0, 0, '', '', 1, 1, 0, 0, 1307992515, 0);
