(5, 2, 0, 'Apa pendapat anda tentang mutu penyampaian program ini?', '', 'r>>>>>Tidak Memuaskan\r|Memuaskan\r|Sangat Memuaskan', 'multichoice', 1, 2, 0, 0, '', 'h'),
