INSERT INTO `question` (`id`, `category`, `parent`, `name`, `questiontext`, `questiontextformat`, `generalfeedback`, `generalfeedbackformat`, `defaultgrade`, `penalty`, `qtype`, `length`, `stamp`, `version`, `hidden`, `timecreated`, `timemodified`, `createdby`, `modifiedby`) VALUES
(1, 2, 0, 'Ali took a housing loan at an interest rate pegged to Base Lending Rate (BLR). Which of the following is TRUE if there is an increase in BLR?', '<p>Ali took a housing loan at an interest rate pegged to BaseLending Rate (BLR). Which of the following is TRUE if there is an increase in BLR?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414183930+Ef9O5q', 'localhost+110414183932+4MPZtc', 0, 1302806370, 1302806371, 2, 2),
(2, 2, 0, 'If you take a housing loan jointly with your spouse and insure the property with MRTA for RM100,000 proportionately. What would happen if your spouse passed away?', '<p>If you take a housing loan jointly with your spouse and insure the property with MRTA for RM100,000 proportionately. What would happen if your spouse passed away?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414184437+AXMo6M', 'localhost+110414184438+M18Zqy', 0, 1302806677, 1302806677, 2, 2),
(3, 2, 0, 'When buying a house, you should _________________', '<p>When buying a house, you should _________________</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414220628+0OrZPo', 'localhost+110414220629+d7Te8c', 0, 1302818788, 1302818788, 2, 2),
(4, 2, 0, 'Generally owning your own home, means all of the following, EXCEPT:', '<p>Generally owning your own home, means all of the following,EXCEPT:</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414221148+EXvg8X', 'localhost+110414221149+N5hxTO', 0, 1302819108, 1302819108, 2, 2),
(5, 2, 0, 'When you decide to apply for a housing loan, what is the most important factor to be considered?', '<p>When you decide to apply for a housing loan, what is themost important factor to be considered?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414221518+ojM1iu', 'localhost+110414221518+jJSN1W', 0, 1302819318, 1302819318, 2, 2),
(6, 2, 0, 'The following are direct and incidental costs usually incurred during property purchase, EXCEPT:', '<p>The following are direct and incidental costs usually incurredduring property purchase, EXCEPT:</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414221631+2TVPZB', 'localhost+110414221631+2bPSye', 0, 1302819391, 1302819391, 2, 2),
(7, 2, 0, 'Besides MRTA, the following are insurance coverages available for your house, EXCEPT:', '<p>Besides MRTA, the following are insurance coveragesavailable for your house, EXCEPT:</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, 'localhost+110414221806+YzK4bn', 'localhost+110414221807+FAHuvB', 0, 1302819486, 1302819486, 2, 2),
(8, 2, 0, '1.1', '<p>Which of the following are the main components ofcash flow management?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422215548+lkG3q1', '10.1.26.119+110422215549+kG1N5d', 0, 1303509348, 1303509349, 2, 2),
(9, 2, 0, '1.2', '<p>A budget helps you to _________</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422221721+ksw5js', '10.1.26.119+110422221722+MLjcOy', 0, 1303510641, 1303510641, 2, 2),
(10, 2, 0, '1.3', '<p>Why is savings important?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422221838+ML6zUs', '10.1.26.119+110422221838+B8J8UQ', 0, 1303510718, 1303510718, 2, 2),
(11, 2, 0, '1.4', '<p>How many months of living expenses are recommendedfor your emergency fund?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422221929+eeWli6', '10.1.26.119+110422221930+z89943', 0, 1303510769, 1303510769, 2, 2),
(12, 2, 0, '1.5', '<p>What is your net worth?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422222056+YiulLA', '10.1.26.119+110422222057+dm7SvS', 0, 1303510856, 1303510856, 2, 2),
(13, 2, 0, '1.6', '<p>What is the minimum monthly recommended percentageof your income to be set aside as savings (apart from EPFcontribution)?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422222152+Q2yD5X', '10.1.26.119+110422222152+pksi8F', 0, 1303510912, 1303510912, 2, 2),
(14, 2, 0, '1.7', '<p>What is a good financial habit?</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422222256+cQBMbn', '10.1.26.119+110422222257+2poJ9F', 0, 1303510976, 1303510976, 2, 2),
(15, 2, 0, '2.1', '<p>Interest rates for unsecured loans tend to be __________</p>', 1, '', 1, 1.0000000, 0.0000000, 'multichoice', 1, '10.1.26.119+110422223724+ErLiIA', '10.1.26.119+110422223724+7Vi3FR', 0, 1303511844, 1303511844, 2, 2),
